import React from "react";
import TemplateList from "./TemplateList";

class TemplateMain extends React.Component {
  render() {
    return (
      <div className="ui grid container">
        <div className="five wide column">
          <TemplateList />
        </div>
      </div>
    );
  }
}

export default TemplateMain;
